// src/pages/HomePage.js
import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/HomePage.css";

const HomePage = () => {
  // Local theme state for toggling light/dark mode
  const [theme, setTheme] = useState("light");

  const handleThemeChange = (e) => {
    setTheme(e.target.value);
  };

  return (
    <div className={`homepage-container ${theme}`}>
      {/* Top bar with logo, site name, nav buttons, and theme dropdown */}
      <div className="top-bar">
        <div className="logo-section">
          <img src="/assets/logo.png" alt="Logo" className="site-logo" />
          <span className="site-name">Sign Language Platfor</span>
        </div>

        <div className="nav-buttons">
          {/* Circular button for Home */}
          <div className="circle">
            <Link to="/" className="circle-button">
              üè† Home
            </Link>
          </div>
          {/* Circular button for Lessons */}
          <div className="circle">
            <Link to="/lessons" className="circle-button">
              üìö Lessons
            </Link>
          </div>
          {/* Circular button for Quiz */}
          <div className="circle">
            <Link to="/quiz" className="circle-button">
              ‚ùì Quiz
            </Link>
          </div>
          {/* Circular button for Profile */}
          <div className="circle">
            <Link to="/profile" className="circle-button">
              üë§ Profile
            </Link>
          </div>
          {/* Circular button for Register */}
          <div className="circle">
            <Link to="/register" className="circle-button">
              üìù Register
            </Link>
          </div>
          {/* Circular button for Login */}
          <div className="circle">
            <Link to="/login" className="circle-button">
              üîë Login
            </Link>
          </div>
          {/* Dropdown circle for Light/Dark Mode */}
          <div className="circle dropdown-circle">
            <select onChange={handleThemeChange} value={theme} className="theme-dropdown">
              <option value="light">‚òÄ Light</option>
              <option value="dark">üåô Dark</option>
            </select>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <main className="main-section">
        <h1>Welcome to Our Sign Language Platform</h1>
        <p>Explore interactive lessons, quizzes, and personalized learning experiences.</p>
        
        {/* Image Scroller for About Section */}
        <section className="about-section">
          <h2>About Our Website</h2>
          <div className="image-scroller">
            <div className="scroller-container">
              {/* Replace these with your own images in /public/assets/ */}
              <img src="/assets/image1.jpg" alt="About 1" />
              <img src="/assets/image2.jpg" alt="About 2" />
              <img src="/assets/image3.jpg" alt="About 3" />
              <img src="/assets/image4.jpg" alt="About 4" />
            </div>
          </div>
        </section>
      </main>

      {/* Footer */}
      <footer className="homepage-footer">
        <p>¬© 2025 Sign Language Platform. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default HomePage;
